import React from 'react';
import BookingForm from './components/bookingform';
import CabList from './components/cablist';

const style = {
  mainContainer: {
    display: "flex",
    flexDirection: "row",
    justifyContent: "center",
    alignContent: "center"
  }
}

function App() {
  return (
    <div>
      <h1>Cab Booking System</h1>
      <div style={style.mainContainer}>

        <BookingForm />
        <CabList />
      </div>
    </div>
  );
}

export default App;
